def unanimous(seq):
	it = iter(seq)
	try:
	  first = next(it)
	except StopIteration:
	  return True
	else:
	  return all(i == first for i in it)

def dict_delete(host):
	for key in [key for key in hosts if key == host]: del hosts[host]

def most_frequent(requiredports):
	max_cnt=[]
	count = Counter(requiredports)
	freq_list = list(count.values())
	max_cnt = max(freq_list)
	total = freq_list.count(max_cnt)
	most_common = count.most_common(total)
	common_ports = [elem[0] for elem in most_common]
	for port in common_ports:
		if port in nmap_tcp_portdict:
			for k,v in nmap_tcp_portdict.items():
				if k == port:
					tempdict[k]=v
		else:
			tempdict[port]='-1' # if it doesn't exist in the nmap port list, give it a value of -1

	# We need to see if the highest valued element occurse multiple times
	keymax = max(tempdict, key=tempdict.get)

	templist = [] # Create a list of these highest valued elements
	for k,v in tempdict.items():
		if v is tempdict[keymax]:
			templist.append(k)
	templist.sort()

	if len(templist) > 1: # If this list is longer than 1, simply give us the lowest port number in the list
		return templist[:1][0]
	else:
		return max(tempdict.items(), key=operator.itemgetter(1))[0] # if it is one, give us the highest value

